import React from 'react'
import PropTypes from 'prop-types'
import { Link } from "react-router-dom";

// we can write either props or {title} and props.title or {title}
export default function Header(props) {
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div className="container-fluid">
                <Link className="navbar-brand" to="/">{props.title}</Link>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                        <li className="nav-item">
                            <Link className="nav-link active" aria-current="page" to="/">Home</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/about">About</Link>
                        </li>
                    </ul>
                    {props.searchBar ?
                        <form className="d-flex">
                            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
                            <button className="btn btn-outline-success" type="submit">Search</button>
                        </form>
                        : "No Search Bar"}
                </div>
            </div>
        </nav>
    )
}
// props is a JavaScript object which we pass from our parent component to child component
// parent component is in App.js

Header.defaultProps = {
    title: "Your Title Here",    // if user does not pass title from parent component then this default title will be displayed
    searchBar: true
}
// mentioning the PropTypes
Header.propTypes = {
    title: PropTypes.string,
    searchBar: PropTypes.bool.isRequired
}
